import React from 'react';
import '../css/VideoPlayer.css';
import carOnFire from '../resources/videos/car-on-fire.avi';
import googleSymptoms from '../resources/videos/google-symptoms.avi';
import knifeMaking from '../resources/videos/knife-making.avi';
import mkbd from '../resources/videos/mkbd.avi';
import mrbeast from '../resources/videos/mrbeast.avi';

const VideoPlayer = (props) => {
  const vidLink = require(`../resources/videos/${props.videoLink}`);

  const myDictionary = {
    'carOnFire': '../resources/videos/car-on-fire.avi',
    'googleSymptoms': '../resources/videos/google-symptoms.avi',
    'knifeMaking': '../resources/videos/knife-making.avi',
    'mkbd': '../resources/videos/mkbd.avi',
    'mrbeast': '../resources/videos/mrbeast.avi'
  };

  return (
    <div id="video-player-wrapper">
      <div id="video-player">
        <video src={vidLink} controls loop />
      </div>
    </div>
  );
};

export default VideoPlayer;
